import * as React from 'react';
import * as ReactDOM from 'react-dom/client';
import { createBrowserRouter, RouterProvider } from 'react-router-dom';
import './index.css';
import Register from './pages/Public/Register/Register';
import Login from './pages/Public/Login/Login';
import Dashboard from './pages/Main/Dashboard/Dashboard';
import Main from './pages/Main/Main';
import Movie from './pages/Main/Movie/Movie';
import Lists from './pages/Main/Movie/Lists/Lists';
import Form from './pages/Main/Movie/Form/Form';
import CastAndCrew from './pages/Main/Movie/CastandCrew/CastandCrew'; // Import the CastAndCrew component

const router = createBrowserRouter([
    { path: '/', element: <Login /> },
    { path: '/register', element: <Register /> },
    { path: '/main', element: <Main />, children: [
        { path: '/main/movies', element: <Movie />, children: [
            { path: '/main/movies', element: <Lists /> },
            { path: '/main/movies/form/:movieId?', element: <Form />, children: [
                { path: '/main/movies/form/:movieId/cast-and-crews', element: <CastAndCrew /> }, // Add this line
                { path: '/main/movies/form/:movieId/photos', element: ( <h1>Change this for photos CRUD functionality component.</h1> ) },
                { path: '/main/movies/form/:movieId/videos', element: ( <h1>Change this for videos CRUD functionality component.</h1> ) },
            ]},
        ]},
    ]},
]);

function App() {
    return (
        <div className='App'>
            <RouterProvider router={router} />
        </div>
    );
}

export default App;
